import React, { useState, useEffect } from "react";
import { uploadBill, getInventory, getAlerts, deleteStock } from "../services/api";

export default function ChemistUpload(){
  const [file, setFile] = useState(null);
  const [msg, setMsg] = useState("");
  const [inventory, setInventory] = useState([]);
  const [alerts, setAlerts] = useState([]);

  const load = () => {
    getInventory().then(r=>setInventory(r.data)).catch(()=>setInventory([]));
    getAlerts().then(r=>setAlerts(r.data)).catch(()=>setAlerts([]));
  };
  useEffect(()=>{ load() },[]);

  const onUpload = async () => {
    if(!file) return setMsg("Choose file first");
    try{
      const res = await uploadBill(file);
      setMsg("Uploaded: "+JSON.stringify(res.data));
      load();
    }catch(e){
      setMsg("Upload error: "+(e?.response?.data?.error || e.message));
    }
  };

  const onDelete = async (p,b) => {
    await deleteStock(p,b);
    load();
  };

  return (
    <div className="card">
      <h2>Upload Bill (CSV or image)</h2>
      <div style={{marginBottom:12}}>
        <input type="file" onChange={e=>setFile(e.target.files[0])} />
        <button style={{marginLeft:8}} onClick={onUpload}>Upload</button>
      </div>
      <div style={{color:"#0b6efd"}}>{msg}</div>

      <h3 style={{marginTop:20}}>Expiry Alerts</h3>
      <div className="grid">
        {alerts.length===0 ? <div className="card">No alerts</div> : alerts.map(a=>(
          <div key={a.alert_id} className="card">
            <div><strong>{a.product_name}</strong></div>
            <div>Batch: {a.batch}</div>
            <div>Exp: {a.exp} ({a.days_to_expiry} days)</div>
          </div>
        ))}
      </div>

      <h3 style={{marginTop:20}}>Inventory</h3>
      <div className="card">
        <table>
          <thead><tr><th>Product</th><th>Batch</th><th>Exp</th><th>Qty</th><th>Action</th></tr></thead>
          <tbody>
            {inventory.map((r,idx)=>(
              <tr key={idx}>
                <td>{r.product_name}</td>
                <td>{r.batch}</td>
                <td>{r.exp}</td>
                <td>{r.qty}</td>
                <td><button className="danger" onClick={()=>onDelete(r.product_name, r.batch)}>Delete</button></td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
